            const {data}=await axios.get('http://127.0.0.1:8000/api/activity/');
            setActivity(data)
        };
        Response()
    },[])
    const cal=activity.map((x,index)=>{
        return (
            <div key={index} >
            {/* <img src="logo.png" alt="nithiesh"/> */}
